create table tickers
(
    updated_at   timestamp with time zone,
    created_at   timestamp with time zone,
    id           text,
    coin         serial not null,
    coin_name    text   not null,
    coin_type    text   not null,
    token_id     text   not null,
    currency     text   not null,
    provider     text   not null,
    change24h    numeric,
    value        numeric,
    volume       numeric,
    market_cap   numeric,
    show_option  integer,
    last_updated timestamp with time zone,
    constraint tickers_pkey
        primary key (coin, coin_name, coin_type, token_id, currency, provider)
);

alter table tickers
    owner to "user";

create index idx_tickers_id
    on tickers (id);

create index idx_tickers_coin
    on tickers (coin);

create index idx_tickers_token_id
    on tickers (token_id);

